import React from "react";
import { useEffect, useState } from "react";
import { APIProvider, Map, Marker } from "@vis.gl/react-google-maps";

const getLocation = () => {
  if (navigator.geolocation) {
    navigator.geolocation.getCurrentPosition((position) => {
      let lat = position.coords.latitude;
      let lng = position.coords.longitude;

      console.log(lat, lng);
    });
  }
};

getLocation();

export default function LocationsMap() {
  const [backendData, setBackendData] = useState([{}]);

  useEffect(() => {
    fetch("/api/v1/places")
      .then((response) => response.json())
      .then((data) => {
        setBackendData(data.results);
      });
  }, []);

  // backendData.forEach((el) => {
  //   console.log(el.geometry.location.lat);
  // });

  const markers = [{ id: 1, position: { lat: 51.0463583, lng: 16.8675189 } }];

  return (
    <APIProvider apiKey={"AIzaSyBLzOyErw_GGeOYghEGKdDdV8Wyfx7kTpw"}>
      <Map
        id="map"
        keyboardShortcuts={false}
        disableDefaultUI={true}
        defaultZoom={13}
        defaultCenter={{ lat: 51.0443583, lng: 16.8675189 }}
        mapId="65ca8f0d0ef266e"
      >
        {markers.map((marker) => (
          <Marker key={marker.id} position={marker.position} />
        ))}
      </Map>
    </APIProvider>
  );
}
